description:
{'plain': 'A single off the Arctic Monkeys 5th album AM, “Why’d You Only Call Me When You’re High?” is a sexy record, that has the band experimenting with R&B sounds.



Alex’s story is made clear on the apropo video, which starts as the previous single “Do I Wanna Know?” tapers off in a club:

http://www.youtube.com/watch?feature=player_embedded&v=6366dxFf-Os'}

