description:
{'plain': 'Perhaps the album’s best song is tucked away just before it ends. Everything about this track is sexy…from the bass drum and simple guitar riff as it opens, to the imagery conjured up by a line like “When you walked around your house wearing my sky blue Lacoste… And your knee socks". And we’re bouncing as the images in Alex’s head come together in a parting crescendo.

Here’s a live version with Homme.
http://www.youtube.com/watch?v=ykd_jrqDdjI'}

