description:
{'plain': 'Ironically, the slowest track off of AM, “No. 1 Party Anthem,” pokes fun at waiting for an anthemic party song to feel the vibe. Some of the lyrics here were first used on Arctic Monkeys greatest hit, “Do I Wanna Know?,” as Alex Turner commented:

Actually, I was looking through my old voice memos on my iPhone this morning, and I found a demo for “Do I Wanna Know?” that I’ve done, and it’s got the lyrics from “No. 1 Party Anthem” on it.

VIA UNDER THE RADAR MAGAZINE'}

