description:
{'plain': 'The song describes advertising for the titular Tranquility Base Hotel & Casino. Some parts read explicitly like an advert, inviting the listener to come and relax at Tranquility Base. The lyrics are set within the universe of the album, describing the new businesses being set up on the Lunar surface and all the potential lovely experiences one might have there, and showing off a good review given to the taqueria: four stars out of five.

The hook also details the meaning behind the Tranquility Base Hotel & Casino’s location, and the space themed narrative begins to unfold.

This song was debuted live before the release of the album with assistance from Tame Impala member Cameron Avery.'}

