description:
{'plain': "“Perhaps Vampires Is a Bit Strong But…” is a song from the Arctic Monkeys' debut album, wherein Alex talks about how people around the band didn’t believe in them. Here “Vampires” refers to the condescending people who stand by them but doesn’t believe in their ability. The people doesn’t understand that Alex and his mates didn’t start the band to earn money, but to be themselves. Matt and Alex described this in an interview:

Alex: It’s like when this time last year we were just doing gigs everywhere and we were having conversations with people, like neighbours and stuff.
Matt: They’re all like “How much’d you get paid for that?” when they had a few beers in and that. You should get down the working mens clubs, 400 a turn on a Saturday night."}

